import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';


function App() {
  return (
      <Routes>
        <Route path="/" element={<AuthPage />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/room/:roomId" element={<VideoRoom />} />
      </Routes>
  );
}

export default App;
